import React from "react";
import Footer from "./components/Footer";
import Header from "./components/Header";
import { Container } from "react-bootstrap";
import HomePage from "./Pages/HomePage";

function App() {
  return (
    <>
      <Header />
      <Container>
        <main>
          <HomePage />
        </main>
      </Container>
      <Footer />
    </>
  );
}

export default App;
